window.addEventListener("load", function(event) {

	if(qs('article.full_article')){
		loadjscssfile("/_js/blog.min.js", "js");
	}

	bLazy = new Blazy({
		selector: '.lz',
		src : 'data-lz',
		offset: 1200,
		// loadInvisible: true, //Set to true if you want to load invisible (hidden) elements.
		separator: '|', //Used if you want to pass retina images: data-src=”image.jpg|image@2x.jpg”
		successClass: 'll',
		saveViewportOffsetDelay: 100, //Delay for how often it should call the saveViewportOffset function on resize. Default is 50ms.
		validateDelay: 50, //Delay for how often it should call the validate function on scroll/resize. Default is 25ms.

		breakpoints: [{
			width: 450, // Max-width
			src: 'data-lz-450'
		},
		{
			width: 1400, // Max-width
			src: 'data-lz-1400'
		},
		{
			width: 1600, // Max-width
			src: 'data-lz-1600'
		}]
	});

	if(qs('.swiper-container')){
		loadjscssfile("/_css/swiper.css", "css");
		loadjscssfile("/_js/swiper.js", "js");
	}
	if(qs('.jtt')){
		loadjscssfile("/_css/tooltipster.bundle.min.css", "css");
		loadjscssfile("/_js/tooltipster.min.js", "js");
	}
	if(qs('.gallery')){
		loadjscssfile("/_css/jquery.fancybox.css", "css");
		loadjscssfile("/_js/jquery.fancybox.js", "js");
	}
	if( (qs('main>.blog')) || (qs('main>.ajx_news')) ){
		loadjscssfile("/_js/infinite.min.js", "js");
	}

});
